input.value:
timeseries totalrequest = sum(log.istion.requestcount , default: 0),   by: { k8s.pod.name, k8s.namespace.name, istio.simplified_url, k8s.deployment.name }, filter: { matchesValue(istio.type, "inbound") AND NOT matchesValue(istion.response_flag, "-") }
| append [timeseries errorrequest = sum(log.istion.requestcount, default:0) ,by: { k8s.pod.name, k8s.namespace.name,istio.simplified_url, k8s.deployment.name }, filter: { matchesValue(istio.type, "inbound") AND  matchesValue(istion.response_flag, "-") }]
 | fieldsAdd   total= arrayAvg(totalrequest), error=arrayAvg(errorrequest)
| fieldsAdd ratio= if(total>0, (error/total)*100 , else: (if(error>0,100,else: 0)))
//| fieldsRemove total, error, totalrequest,errorrequest

